const estado={
  second: 20
}

const clockReducer =(state=estado, action)=>{
   switch(action.type){
    case play:
        return{
     second: state.second-1
      }
   }
}

const play="play";

const Play=()=>{
    return{
        type: play
    }
}

export default clockReducer
export {Play}
